-- Insert data into tables only if the tables (license_definition, license_label, license_label_extended_mapping)
-- are empty
DO $$
BEGIN
    -- Check if the 'license_definition' table is empty
    PERFORM 1 FROM public.license_definition LIMIT 1;
    IF NOT FOUND THEN
        -- Check if the 'license_label' table is empty
        PERFORM 1 FROM public.license_label LIMIT 1;
        IF NOT FOUND THEN
            -- Check if the 'license_label_extended_mapping' table is empty
            PERFORM 1 FROM public.license_label_extended_mapping LIMIT 1;
            IF NOT FOUND THEN
                -- All three tables are empty, so insert data

